import React, { useState } from "react";
import { Button, Collapse, Layout } from "antd";
import { MenuUnfoldOutlined, MenuFoldOutlined } from "@ant-design/icons";
import Sidebar from "../src/components/Sidebar";
import viewExamsheet from "../src/pages/viewExamsheet";
import uploadExamsheet from "../src/pages/uploadExamsheet";
import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

const { Sider, Content } = Layout;
function App() {
  const [collapsed, setCollapsed] = useState(false);

  return (
    <Layout>
      <Sider
        theme="light"
        trigger={null}
        collapsible
        collapsed={collapsed}
        collapsedWidth={90}
        className={`sider ${collapsed ? "collapsed" : ""}`}
      >
        <Sidebar />

        <Button
          type="text"
          icon={collapsed ? <MenuUnfoldOutlined /> : <MenuFoldOutlined />}
          onClick={() => setCollapsed(!collapsed)}
          className=" triger-btn"
        />
      </Sider>

      <Layout>
        <Content className="content">
          <Switch>
            <Route path="/uploadExamsheet">
              {/* Component or content for Upload Exam Sheet */}
            </Route>
            <Route path="/viewExamsheet"></Route>
          </Switch>
        </Content>
      </Layout>
    </Layout>
  );
}

export default App;
